    "prettier:check": "prettier --list-different \"./**/*.{md,json,yaml,js,ts}\"",
    "test": "npm link && npm link ajv-keywords && npm run eslint && npm run test-cov",
    "eslint": "eslint \"src/**/*.*s\" \"spec/**/*.*s\"",
