    "@types/chai": "^4.2.14",
    "@types/jest": "^26.0.14",
    "@types/node": "^16.4.10",
    "@types/uuid": "^8.3.0",
    "@typescript-eslint/eslint-plugin": "^4.4.1",
    "@typescript-eslint/parser": "^4.4.1",
    "ajv": "^8.8.2",
    "ajv-formats": "^2.0.0",
    "chai": "^4.2.0",
    "eslint": "^7.2.0",
    "eslint-config-prettier": "^7.0.0",
    "husky": "^7.0.1",
    "jest": "^26.5.3",
    "json-schema-test": "^2.0.0",
    "lint-staged": "^11.1.1",
